import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
export class GeneroService {

  constructor(
    private http: HttpClient
  ) { }

  load(){
    return this.http.get('http://localhost:3000/generos')
  }
}
